import React, { Component } from 'react'
import Layout from '../components/layout.js'


const layout2Style = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
}

export default function Layout2(props) {
  return (
    <Layout>
      
    <div style={layout2Style}>
      {props.children}
    </div>
    </Layout>
  )
}
